import copy
import math
class Solution:
    def findmaxlen(self,idx,length,mark):
        i = idx[0]
        j = idx[1]
        lengthRes = []
        for element in [[i,j+1],[i,j-1],[i-1,j],[i+1,j]]:
            if not (element[0]>=len(self.matrix) or element[1]>=len(self.matrix[0]) or element[0]<0 or element[1]<0):
                if self.matrix[element[0]][element[1]] <= self.matrix[idx[0]][idx[1]]:
                    lengthRes.append(length)
                elif not (element in mark):
                    mark.append(element)
                    sublength,mark = self.findmaxlen(element,length+1,mark)
                    lengthRes.append(sublength)
            else:
                lengthRes.append(length)
        return max(lengthRes),mark

    def findsmallValidx(self,updateMat):
        minidx = []
        value = []
        for i in range(len(updateMat)):
            minidx.append(i)
            minidx.append(updateMat[i].index(min(updateMat[i])))
        for i in range(int(len(minidx)/2)):
            value.append(updateMat[minidx[0+i*2]][minidx[1+i*2]])
        minidid = value.index(min(value))
        updateMat[minidx[minidid * 2]][minidx[minidid * 2 + 1]] = 10**100
        return [minidx[minidid * 2], minidx[minidid * 2 + 1]],updateMat

    def longestIncreasingPath(self, matrix):
        """
        :type matrix: List[List[int]]
        :rtype: int
        """
        if matrix == [] or matrix[0]==[]:
            return 0
        self.matrix = matrix
        matrixSize = len(matrix)*len(matrix[0])
        possibleLen = [1]
        updateMat = copy.deepcopy(self.matrix)
        mark = []
        for i in range(math.ceil(matrixSize/2)):
            smallestValIdx,updateMat = self.findsmallValidx(updateMat)
            if smallestValIdx in mark:
                break
            else:
                nodelength,mark = self.findmaxlen(smallestValIdx,1,mark)
                possibleLen.append(nodelength)
        print(max(possibleLen))
        return max(possibleLen)


